column2:
What is output to the console when this code is run?

var f = function(a) {
    return a.length;
}
var val = f.call(null, [1, 2, 3]);
console.log(val);

What is output to the console when this code is run?

var f = function(a) {
    return a.length;
}
var val = f.apply(null, ["abcd", "123", "456"]);
console.log(val);

What is output to the console when this code is run?

var f = function(a) {
    return a.length;
}
var val = f.bind(null, ["abcd", "123", "456"])();
console.log(val);
